class Solution {
public:
    int minimumOperationsToMakeEqual(int x, int y) {
        int operations = 0;
        while (x != y) {
            if (x > y) {
                if (x % 11 == 0 && x / 11 >= y) {
                    x /= 11;
                } else if (x % 5 == 0 && x / 5 >= y) {
                    x /= 5;
                } else {
                    x--;
                }
            } else {
                if ((y - x) % 2 == 0 || y / 5 < x || y / 11 < x) {
                    x++;
                } else if (x * 5 <= y) {
                    x *= 5;
                } else if (x * 11 <= y) {
                    x *= 11;
                } else {
                    x++;
                }
            }
            operations++;
        }
        return operations;
    }
};
